// =============================
// DEPENDENCIES
// =============================
// packages
import React from 'react'

// =============================
// COMPONENT CLASS
// =============================
class Header extends React.Component {
  render () {
    return (
      <header>
        <h1>What Are You Watching Tonight?</h1>
        <img src="http://www.sclance.com/pngs/popcorn-kernel-png/popcorn_kernel_png_1100209.png" alt="popcorn" height="42" width="42"/>
      </header>
    )
  }
}

// =============================
// EXPORT
// =============================
export default Header
